import React from 'react';
import { Header } from '../../components';

const showcase = () => {
  return (
    <div>
      <h2>The World of Art</h2>
    </div>
  )
}

const Home = () => {
  return (
    <div className='bg-gradient-to-b from-[#B97BF4] to-[#212121]'>
      <Header />

      { showcase() }

    </div>
  )
}

export default Home;
